import React, { useState } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import { FaBars, FaTimes, FaPhone } from 'react-icons/fa';
import { motion } from 'framer-motion';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();

  const navItems = [
    { name: 'Home', path: '/' },
    { name: 'About', path: '/about' },
    { name: 'FAQ', path: '/faq' },
    { name: 'Contact', path: '/contact' },
  ];

  const scrollToTestimonials = () => {
    if (location.pathname !== '/') {
      navigate('/');
      setTimeout(() => {
        const testimonialsSection = document.getElementById('testimonials');
        if (testimonialsSection) {
          testimonialsSection.scrollIntoView({ behavior: 'smooth' });
        }
      }, 100);
    } else {
      const testimonialsSection = document.getElementById('testimonials');
      if (testimonialsSection) {
        testimonialsSection.scrollIntoView({ behavior: 'smooth' });
      }
    }
  };

  return (
    <nav className="bg-white shadow-lg sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center h-16">
          {/* Logo */}
          <Link to="/" className="flex items-center space-x-2">
            <div className="w-10 h-10 rounded-full overflow-hidden flex items-center justify-center bg-white shadow-sm">
              <img 
                src="/logo.jpeg" 
                alt="Feet First Wellness Clinic Logo" 
                className="w-full h-full object-cover rounded-full"
              />
            </div>
            <span className="text-xl font-semibold text-gray-800">Feet first foot care & wellness clinic</span>
          </Link>

          {/* Desktop Navigation */}
          <div className="hidden md:flex items-center space-x-8">
            <Link
              to="/"
              className={`px-3 py-2 rounded-md text-sm font-medium transition-colors ${
                location.pathname === '/'
                  ? 'text-primary border-b-2 border-primary'
                  : 'text-gray-700 hover:text-primary'
              }`}
            >
              Home
            </Link>
            <button
              onClick={scrollToTestimonials}
              className="px-3 py-2 rounded-md text-sm font-medium text-gray-700 hover:text-primary transition-colors"
            >
              Services
            </button>
            {navItems.slice(1).map((item) => (
              <Link
                key={item.name}
                to={item.path}
                className={`px-3 py-2 rounded-md text-sm font-medium transition-colors ${
                  location.pathname === item.path
                    ? 'text-primary border-b-2 border-primary'
                    : 'text-gray-700 hover:text-primary'
                }`}
              >
                {item.name}
              </Link>
            ))}
            <Link
              to="/book-appointment"
              className="bg-primary text-white px-4 py-2 rounded-full hover:bg-secondary transition-colors"
            >
              Book Appointment
            </Link>
            <a
              href="tel:403-903-4293"
              className="flex items-center space-x-1 text-primary hover:text-secondary transition-colors"
            >
              <FaPhone className="w-4 h-4" />
              <span className="text-sm font-medium">403-903-4293</span>
            </a>
          </div>

          {/* Mobile menu button */}
          <div className="md:hidden">
            <button
              onClick={() => setIsOpen(!isOpen)}
              className="text-gray-700 hover:text-primary focus:outline-none"
            >
              {isOpen ? <FaTimes className="w-6 h-6" /> : <FaBars className="w-6 h-6" />}
            </button>
          </div>
        </div>

        {/* Mobile Navigation */}
        {isOpen && (
          <motion.div
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            className="md:hidden bg-white border-t"
          >
            <div className="px-2 pt-2 pb-3 space-y-1">
              <Link
                to="/"
                onClick={() => setIsOpen(false)}
                className={`block px-3 py-2 rounded-md text-base font-medium ${
                  location.pathname === '/'
                    ? 'text-primary bg-accent'
                    : 'text-gray-700 hover:text-primary hover:bg-accent'
                }`}
              >
                Home
              </Link>
              <button
                onClick={() => {
                  scrollToTestimonials();
                  setIsOpen(false);
                }}
                className="block w-full text-left px-3 py-2 rounded-md text-base font-medium text-gray-700 hover:text-primary hover:bg-accent"
              >
                Services
              </button>
              {navItems.slice(1).map((item) => (
                <Link
                  key={item.name}
                  to={item.path}
                  onClick={() => setIsOpen(false)}
                  className={`block px-3 py-2 rounded-md text-base font-medium ${
                    location.pathname === item.path
                      ? 'text-primary bg-accent'
                      : 'text-gray-700 hover:text-primary hover:bg-accent'
                  }`}
                >
                  {item.name}
                </Link>
              ))}
              <Link
                to="/book-appointment"
                onClick={() => setIsOpen(false)}
                className="block w-full text-center bg-primary text-white px-3 py-2 rounded-md font-medium hover:bg-secondary transition-colors"
              >
                Book Appointment
              </Link>
              <a
                href="tel:403-903-4293"
                className="flex items-center justify-center space-x-1 text-primary hover:text-secondary transition-colors px-3 py-2"
              >
                <FaPhone className="w-4 h-4" />
                <span className="font-medium">403-903-4293</span>
              </a>
            </div>
          </motion.div>
        )}
      </div>
    </nav>
  );
};

export default Navbar;
